      console.log("HATDOG");
      console.log(icons.homeScreenButton1);
      return (
            <View>
                  {/* <Image source={icons.homeScreenButton1} /> */}
                  <Text>{type(icons.homeScreenButton1)}</Text>
                  <TouchableOpacity>
                        <Text>{buttonVals[0].title}</Text>
